import React from 'react'
import { Link } from "react-router-dom";

function App() {
  const mystyle = {
    textAlign: 'center', marginTop: '40px'
  };
  return (
    <div>

      <nav style={mystyle}>
        <Link to="/">Home</Link> |{" "}
        <Link to="form">Form</Link>
      </nav>
    </div>
  )
}

export default App
